import './App.css';
import { ProgressBar } from './progressBar/ProgressBar';

const thresholds = [20, 50, 100, 200, 500, 1000]

function App() {
  return (
    <div style={{justifyContent: "center"}}>
      <ProgressBar thresholds={thresholds} value={20}/>
    </div>
  );
}

export default App;
